import {
    HomeOutlined,
    SettingFilled,
    SmileOutlined,
    SyncOutlined,
    LoadingOutlined,
    BulbTwoTone,
    PieChartTwoTone,
    StarTwoTone
  } from '@ant-design/icons';
import { Layout, Menu, Breadcrumb,Button,Space,Card} from 'antd';
import React from 'react';
import { Routes,BrowserRouter as Router,Route,Link,NavLink,Outlet  } from 'react-router-dom';


class Home extends React.Component{
    render(){
        return(

            <div>
                <Card style={{ width: 800 }}>
                <BulbTwoTone style={{ fontSize: '100px', color: '#08c',margin:"auto"}}/>
                <PieChartTwoTone style={{ fontSize: '100px', color: '#08c' }} />
                <StarTwoTone style={{ fontSize: '100px', color: '#08c' }}/>
                </Card>
                
            </div>
            )
    }
}
export default Home;
